import React from 'react'
import Menu from './Menu'

const ShowContact = () => {
  const contacts = [
        {
          whatsapp: '8 *** ** **',
          telegram: '8 *** ** **',
          instagram: '@cherlston'
        }
      ]
    return (
      <main>
        <Menu header={"Контакты"} contacts={contacts}/>
      </main>
    )
}

export default ShowContact
